                      </StyledTableCell> */}
                      <StyledTableCell align="right">
                        {item.discount}
                      </StyledTableCell>
                      {/* <StyledTableCell align="right">
                        {item.deal}
                      </StyledTableCell> */}
                      <StyledTableCell align="right">

                        <Link to={{
                          pathname: '/PartnersUpdate',
                          state: { detail: { item } }
                        }}>
                          <Button style={{ marginLeft: '20px', marginTop: '50px', backgroundColor: '#008037' }} variant="outline-success" >
                            <EditIcon />

                          </Button>
                        </Link>
                      </StyledTableCell>
                      <StyledTableCell align="right">
                        <div>
                        <Button style={{ marginLeft: '20px', marginTop: '50px', backgroundColor: '#008037' }} variant="outline-success" onClick={() => handleClickOpen()} >
                          <ClearIcon />
                        </Button>
                        <Dialog
                          open={open}
